import React, { useEffect } from 'react';
import { getDetailComics } from '../store/charactersSlice';
import { useDispatch, useSelector } from "react-redux";
import { useParams } from "react-router-dom";

export default function Characters_comics(){

    const { id } = useParams();

    const dispatch = useDispatch();
    const detailObject = useSelector(({ characters }) => characters.charactersComics)
    //Get data detail
    useEffect(() => {
        dispatch(getDetailComics())
    }, [])
    return (
        <div>
            <p>Holamundo</p>
        </div>

    )
}
